// src/components/Contact.js
import { Box, Heading, Text, Flex, Input, Button } from '@chakra-ui/react';

const Contact = () => (
  <Box id="contact" py="10" px="5" bg="orange.100">
    <Heading textAlign="center">Get in Touch</Heading>
    <Text textAlign="center" mt="4">Feel free to reach out for collaborations or just a friendly chat.</Text>
    <Flex mt="6" direction="column" maxW="400px" mx="auto">
      <Input placeholder="Your Name" mb="4" />
      <Input placeholder="Your Email" mb="4" />
      <Input placeholder="Your Message" mb="4" />
      <Button colorScheme="">Send Message</Button>
    </Flex>
  </Box>
);
export default Contact;
